import React from 'react'
import Precart from '../components/CartBlocks/Precart/Precart'
import ProductsCart from '../components/CartBlocks/ProductsCart/ProductsCart'
import Banner from '../components/Banner/Banner';

export default function Cart() {
  return (
    <Banner>
      <h1>Shopping cart</h1>
      <div style={{display: 'flex'}}>
        <Precart />
        <ProductsCart />
      </div>
    </Banner>
  )
}
